        public int Length_Of_Longest_Substring_1(string s)
        {
            int words_max_length = 0;

            if ( s.Length <= 1 )
                words_max_length = s.Length;

            for ( int length = 0; length < s.Length; length++ )
            {
                string words = "";
                for ( int sub_length = length; sub_length < s.Length; sub_length++ )
                {
                    if ( words.Contains(s[sub_length]) )
                    {
                        break;
                    }
                    else
                    {
                        words += s[sub_length];
                    }

                    if ( words.Length > words_max_length )
                        words_max_length = words.Length;
                }
            }

            return words_max_length;
        }
        
        public int Length_Of_Longest_Substring_2(string s)
        {
            List<string> value = new List<string>();

            string temp = "";
            for ( int index = 0; index < s.Length; index++ )
            {
                foreach ( char txt in s.Substring(index) )
                {
                    if (  temp.Contains(txt) )
                    {
                        if ( !value.Contains(temp) )
                            value.Add(temp);
                        break;
                    }
                    else
                    {
                        temp += txt;
                    }
                }
                if(!value.Contains(temp))value.Add(temp);
                temp = "";
            }

            if ( value.Count == 0 )
                return 0;

            int answer = value.Select(x => x.Length).Max();
            return answer;
        }

